import { useState } from "react";

import SideNav from "./SideNav";
import FileUpload from "./FileUpload";

const SignUpImages = () => {

    const [images, setImages] = useState([]);

    return (
        <div className='partner-signup container mt-5'>
            <div className='row mt-5 pt-5'>
                <SideNav />
                <div className='col-lg-6 col-md-8 col-10 ms-2'>
                    <h2 className='d-flex justify-content-start fw-light lh-lg'>Upload images</h2>
                    <div className='my-3'>
                        <form onSubmit={''} className='container'>
                            <div className='form-group shadow p-3 my-3 row'>
                                <h6 className='text-start'>Menu images</h6>
                                <p className='fw-light text-start m-0'>Your menu will be directly visible to customers on Zomato</p>
                                <div className='col-12 my-3 mb-md-1 px-3 text-start shadow'>
                                    <label htmlFor='formFile' className='col-md-3 d-none d-md-block col-form-label text-end fw-bold fs-6'>Image</label>
                                    <div className='col-md-8 col-12 mb-3 mb-md-1 p-0 text-start'>
                                        <FileUpload
                                            id={'formFile'}
                                            images={images}
                                            setImages={setImages}
                                            setLoading={setLoading}
                                        />
                                    </div>
                                </div>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default SignUpImages;
